description:
Obsession. Temptation. Deception. Sometimes love has a mind of its own.
Experience a torrid tale of love featuring the sultry and sexy Stoya. With striking features and all-natural beauty, Stoya is torn between the girl she pretends to be and the two lovers that she seduces and desires most.

Christian, Mick Blue, Mr Pete, Nicole Ray, Sasha Grey, Scott Nails, Stoya, Tony DeSergio

